import React from 'react';
import styled from 'styled-components';

const StyledSlideSix = styled.div`
  position: relative;
  background: #FFFFFF;
  height: 100vh;
  width: 100vw;

  #yellow-block {
    height: 80vh;
    width: 40vw;
    background: #FAC943;
    position: absolute;
    left:  80px;
    top: 0px;

    #customer-img {
      height: 75vh;
      transform: scaleX(-1);
      position: absolute;
      bottom: 0px;
      left: 10vh;
    }
  }
`;

function SlideSix() {
  return (
    <StyledSlideSix className="slide-six">
      <div id='yellow-block'>
        <img id='customer-img' src='images/alex.png' alt='customer' /> 
      </div>
    </StyledSlideSix>
  );
}

export default SlideSix;
